// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import ApplicationForm from './components/ApplicationForm';
import Review from './components/Review';
import UserProfile from './components/UserProfile';
import Notifications from './components/Notifications';
import JobSearch from './components/JobSearch';
import ResumeUpload from './components/ResumeUpload';
import PrivateRoute from './components/PrivateRoute'; // Optional: For protecting routes

const App = () => {
    return (
        <Router>
            <div className="App">
                <h1>Job Application Portal</h1>
                <Switch>
                    <Route path="/" exact component={Login} />
                    <Route path="/register" component={Register} />
                    <PrivateRoute path="/dashboard" component={Dashboard} />
                    <PrivateRoute path="/apply" component={ApplicationForm} />
                    <PrivateRoute path="/review" component={Review} />
                    <PrivateRoute path="/profile" component={UserProfile} />
                    <PrivateRoute path="/notifications" component={Notifications} />
                    <PrivateRoute path="/job-search" component={JobSearch} />
                    <PrivateRoute path="/upload-resume" component={ResumeUpload} />
                    <Route path="*" component={() => <h2>404 Not Found</h2>} />
                </Switch>
            </div>
        </Router>
    );
};

export default App;
